(()=>{"use strict";const t=new class{constructor(t){this.title=t}}("ES6 App"),n=["burger, tacos, sushi, wrap, nacho"];n.sort();const o=new class{constructor(t){this.bodyContent=t,this.option=n}}("Body Content!");new class{constructor(){this.renderTemplate()}renderTemplate(){const n=`   \n            <h1>${t.title}</h1>\n            <h2>${o.option}</h2>\n            <p>${o.bodyContent}</p>\n        \n        `;document.body.innerHTML=n}}})();